    // :: Serviços LC116
    public static function Get_options_nf_servicos_lc116($sel_code_id = null) {

        // # Cache
        $CK            = 'Get_options_nf_servicos_lc116';
        $html           = Cache::get($CK);
        if($html !== null and $sel_code_id == null) { return $html; }
        // - #

        $nf_servicos_lc116_lista    = self::$nf_servicos_lc116_lista;
        $html                       = '';
        $abr                        = 0;
        $html                      .= '<option value="">---</option>';
        foreach($nf_servicos_lc116_lista as $K => $LC116){
            if(is_null($LC116['cod_servico'])){
                if($abr){ $html    .= '</optgroup>'; }
                $abr = 1;
                $html .= '<optgroup label="'.$LC116['cod'].' - '.$LC116['descricao'].'">';
            }
            if(!is_null($LC116['cod_servico'])){
                $html              .= '<option value="'.str_replace('.','',$LC116['cod_servico']).'" '.(($sel_code_id==str_replace('.','',$LC116['cod_servico']))?'selected="selected"':'').'>'.$LC116['cod_servico'].' - '.$LC116['descricao'].'</option>';
            }
            if(count($nf_servicos_lc116_lista) == $K+1){
                $html              .= '</optgroup>';
            }
        }

        // # Cache
        Cache::forever($CK, $html);
        // - #

        return $html;
    }

